function checkUnique(s: string, start: number, end: number): boolean {
    const charsSet = new Set();
    for(let index = start; index <= end; index++){
        if (charsSet.has(s[index])){
            return false;
        }
        charsSet.add(s[index])
    }
    return true;
}

function lengthOfLongestSubstring(s: string): number {
    let max_len = 0;
    let curr = 0;
    let hash = new Map<string, number>();
    if(s.length < 2) {
        return s.length;
    }
    for(let i = 0; i < s.length;  i++) {
        if(hash.has(s[i])) {
            curr += 1;
        } else {
            curr = Math.min(i - hash.get(s[i]), curr + 1);
        }
        max_len = Math.max(max_len, curr);
        hash.set(s[i], i); //save the index
    }
    return max_len;
}

